import { test } from '@playwright/experimental-ct-svelte'
import { expect } from '@playwright/test'
import BasicProfile from './BasicProfile.svelte'
const profileImage =
  'data:image/jpeg;base64,'

// eslint-disable-next-line no-empty-pattern
test.beforeEach(async ({}, testInfo) => {
  testInfo.snapshotSuffix = ''
})

test.describe('BasicProfile for pc', () => {
  test.use({ viewport: { width: 768, height: 300 } })
  test('should render', async ({ mount, page }) => {
    const component = await mount(BasicProfile, {
      props: {
        name: 'ムート',
        breed: 'トイプードル',
        birthday: '2021-10-25T12:00:00+09:00',
        sex: '♂',
        profileImage: profileImage,
        familyDay: '2022-01-15T12:00:00+09:00'
      }
    })
    await page.waitForLoadState('load')
    await expect(page).toHaveScreenshot({maxDiffPixelRatio: 0.8})
  })
})

test.describe('BasicProfile for sp', () => {
  test.use({ viewport: { width: 320, height: 300 } })
  test('should render', async ({ mount, page }) => {
    const component = await mount(BasicProfile, {
      props: {
        name: 'ムート',
        breed: 'トイプードル',
        birthday: '2021-10-25T12:00:00+09:00',
        sex: '♂',
        profileImage: profileImage,
        familyDay: '2022-01-15T12:00:00+09:00'
      }
    })
    await page.waitForLoadState('load')
    await expect(page).toHaveScreenshot({maxDiffPixelRatio: 0.8})
  })
})
